import React from 'react'
import { Grid, Typography } from '@mui/material'
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

const Connect = () => {
    const textFieldData = [
        {
          id: 'outlined-error',
          label: 'Error',
          defaultValue: 'Hello World',
          variant: 'outlined',
          helperText: '',
        },
        {
          id: 'outlined-error-helper-text',
          label: 'Error',
          defaultValue: 'Hello World',
          variant: 'outlined',
          helperText: 'Incorrect entry.',
        },
        {
          id: 'filled-error',
          label: 'Error',
          defaultValue: 'Hello World',
          variant: 'filled',
          helperText: '',
        },
        {
          id: 'filled-error-helper-text',
          label: 'Error',
          defaultValue: 'Hello World',
          variant: 'filled',
          helperText: 'Incorrect entry.',
        },
        {
          id: 'standard-error',
          label: 'Error',
          defaultValue: 'Hello World',
          variant: 'standard',
          helperText: '',
        },
        {
          id: 'standard-error-helper-text',
          label: 'Error',
          defaultValue: 'Hello World',
          variant: 'standard',
          helperText: 'Incorrect entry.',
        },
      ];

  return (
    <Grid container sx={{backgroundColor:'#efefef'}}>
      <Grid item xs={12}>
      <Typography variant='h3' sx={{fontWeight:600, fontsise:'30px' ,mt:1, color:'#907394', textAlign:'center'}}>
                Connect Now 
                </Typography>

      </Grid>
      <Box
      component="form"
      sx={{
        display: 'flex',
        flexWrap: 'wrap',
        justifyContent: 'center',
        alignItems: 'center',
        gap: '20px',
      }}
      noValidate
      autoComplete="off"
    >
      {textFieldData.map((field, index) => (
        <TextField
          key={index}
          error
          id={field.id}
          label={field.label}
          defaultValue={field.defaultValue}
          variant={field.variant}
          helperText={field.helperText}
          sx={{
            width: '25ch',
            margin: '8px',
            '& .MuiFormHelperText-root': {
              color: 'red', // Custom style for helper text
            },
          }}
        />
      ))}
    </Box>
    </Grid>
  )
}

export default Connect
